#
# TABLE STRUCTURE FOR: data_lembur
#

DROP TABLE IF EXISTS `data_lembur`;

CREATE TABLE `data_lembur` (
  `id_data_lembur` int(25) NOT NULL AUTO_INCREMENT,
  `id_karyawan` int(25) DEFAULT NULL,
  `no_lembur` varchar(255) DEFAULT NULL,
  `jenis_lembur` varchar(255) NOT NULL,
  `jam_mulai` time DEFAULT NULL,
  `jam_selesai` time DEFAULT NULL,
  `tgl_mulai` date DEFAULT NULL,
  `tgl_selesai` date DEFAULT NULL,
  `jumlah_lembur` varchar(255) DEFAULT NULL,
  `potong_jam` varchar(255) DEFAULT NULL,
  `kode_customer` varchar(255) DEFAULT NULL,
  `keterangan` text,
  `tgl_buat` date DEFAULT NULL,
  `dibuat_oleh` varchar(255) DEFAULT NULL,
  `diperiksa_oleh` varchar(255) DEFAULT NULL,
  `diketahui_oleh` varchar(255) DEFAULT NULL,
  `validasi` varchar(2) DEFAULT NULL,
  `val_tgl_mulai` datetime DEFAULT NULL,
  `val_tgl_selesai` datetime DEFAULT NULL,
  `val_jumlah_lembur` varchar(50) DEFAULT NULL,
  `val_potong_jam` varchar(22) DEFAULT NULL,
  `val_catatan` text,
  `status_potong` varchar(255) DEFAULT '0',
  `status` varchar(255) DEFAULT NULL,
  `create_date` datetime DEFAULT NULL,
  `update_date` datetime DEFAULT NULL,
  `create_by` tinyint(255) DEFAULT NULL,
  `update_by` tinyint(255) DEFAULT NULL,
  `token` text,
  `date_now` datetime DEFAULT NULL,
  PRIMARY KEY (`id_data_lembur`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=834 DEFAULT CHARSET=latin1 ROW_FORMAT=DYNAMIC;



